import CategoryPage from "@pages/category";
import CustomerPage from "@pages/customer";
import DashboardPage from "@pages/dashboard";
import LoginPage from "@pages/login";
import NotFoundPage from "@pages/notFound";
import SettingPage from "@pages/setting";
import ShopPage from "@pages/shop";
import { BrowserRouter, Navigate, Route, Routes } from "react-router-dom";
import ProtectedRoute from "./ProtectedRoute";

const RouterPage = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Navigate to="/auth/admin/login" />} />
        <Route
          path="/auth/admin/login"
          element={<LoginPage></LoginPage>}
        ></Route>
      <ProtectedRoute path="/admin/dashboard" element={<DashboardPage />} />
      <ProtectedRoute path="/admin/users" element={<CustomerPage />} />
      <ProtectedRoute path="/admin/shop" element={<ShopPage />} />
      <ProtectedRoute path="/admin/category" element={<CategoryPage />} />
      <ProtectedRoute path="/admin/setting" element={<SettingPage />} />
      <Route path="/404" element={<NotFoundPage />} /> {/* Route cho trang 404 */}
      <Route path="*" element={<Navigate to="/404" />} /> {/* Bắt tất cả các route không tồn tại */}
      </Routes>
    </BrowserRouter>
  );
};

export default RouterPage;
